import './App.css';
import Navbar from './components/Navbar'
import MainContent from './components/MainContent'

function App() {
  return (
    <div className="App">
      <div className="Navbar">
        <Navbar />
      </div>
      <div className="MainContent">
        <MainContent />
      </div>
    </div>
  );
}

export default App;
